using SeedPropertyAccess;

var client = new SeedPropertyAccessClient();
await client.CreateUserAsync(
    new User
    {
        Id = "id",
        Email = "email",
        Password = "password",
        Profile = new UserProfile
        {
            Name = "name",
            Verification = new UserProfileVerification { Verified = "verified" },
            Ssn = "ssn",
        },
    }
);
